import {Form, Input, Button,  Checkbox} from 'antd';


const layout={
	labelCol:{span:8},
	wrapperCol:{span:16},
};


const HomePage=()=>{
	return (
		<div>
			
			<Form
				{...layout}
			>
				<Form.Item
					label="Username"
					name="username"
					rules={[{required:true,message:'Please input your username!'}]}
				>
					<Input/>
				</Form.Item>
			</Form>

			
		</div>
	);
}
export default HomePage;
